import React from 'react';

const CartItem = ({ item, onRemove }) => (
  <div className="cart-item">
    <span>{item.food.name} x {item.quantity}</span>
    <button onClick={() => onRemove(item.food._id)}>Remove</button>
  </div>
);

export default CartItem;
